// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "./Security.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "./StringHelper.sol";

contract MyMiniMiners is ERC20, Security, ReentrancyGuard {
    using SafeMath for uint256;

    //********************Token variables************************//


    // percent fee for each transfer in  bps 100 = 1%;
    uint256 private _transferFee = 1000;

    //  fee for gas
    uint256 private _gasFee = 10 ** 15;

    // represents the avg coin rate that can be found each second
    uint256 private _coinMineRate = 10;
    // represent the maximum tokens that can be minted
    uint256 private _maxSupply = 10 ** 9 * 10 ** 9 + 10 ** 8 * 10 ** 9;

    uint256 private _supplyLeft;

    uint256 private _createAt;
    //********************Token variables end ************************//


    event Mint(address indexed from, address indexed to, uint256 value, string appTransactionId);
    event PayForAppTransaction(address indexed from, uint256 value, string appTransactionId);

    constructor(address feesAccount, address payable gameServiceAccount)  payable ERC20("My Mini Miners", "MYMM")  ReentrancyGuard() {
        setFeesAccount(feesAccount);
        setGameServiceAccount(gameServiceAccount);
        _createAt = block.timestamp;
        _supplyLeft = _maxSupply;
        _mint(_feesAccount, 10 ** 8 * 10 ** 9, "            first mint for presale              ");
    }

    //********************Token methods************************//

    function decimals() public pure override returns (uint8) {
        return 9;
    }

    function getMaxSupply() public view returns (uint256){
        return _maxSupply;
    }

    function getSupplyLeft() public view returns (uint256){
        return _supplyLeft;
    }


    function getUnclaimedTokens() public view returns (uint256){
        uint256 maxTokens = block.timestamp.sub(_createAt).mul(_coinMineRate).mul(10 ** 9) + 10 ** 8 * 10 ** 9;
        uint256 minted = _maxSupply.sub(_supplyLeft);
        uint256 unclaimedTokens = maxTokens.sub(minted);
        if (unclaimedTokens > _supplyLeft) {
            return _supplyLeft;
        }
        return unclaimedTokens;
    }

    function getCoinMineRate() public view returns (uint256){
        return _coinMineRate;
    }

    function getTransferFee() public view returns (uint256){
        return _transferFee;
    }

    function getGasFee() public view returns (uint256){
        return _gasFee;
    }

    function setTransferFee(uint256 transferFee) external onlyFeesAccount {
        require(transferFee > 0 && transferFee <= 1000, "transfer fee must be between 0 - 1000");
        _transferFee = transferFee;
    }

    function setCoinRate(uint256 coinRate) external onlyFeesAccount {
        require(coinRate >= 0 && coinRate <= 10, "coin rate must be between 0 - 10");
        _coinMineRate = coinRate;
    }

    function setGasFee(uint256 gasFee) external onlyFeesAccount {
        require(_gasFee > 0, "gas fee need to be more then 0");
        _gasFee = gasFee;
    }




    function payForAppTransaction(string calldata appTransactionId) public payable nonReentrant {
        StringHelper.validateAppTransactionId(appTransactionId);
        require(msg.value >= _gasFee, "not enough gas");
        _gameServiceAccount.transfer(msg.value);
        emit PayForAppTransaction(_msgSender(), msg.value, appTransactionId);
    }

    function mint(address account, uint256 amount, string calldata appTransactionId) external onlyGameService {
        _mint(account, amount, appTransactionId);
    }

    function _mint(address account, uint256 amount, string memory appTransactionId) private {
        require(_supplyLeft >= amount, "amount is bigger  then the total supply left");
        StringHelper.validateAppTransactionId(appTransactionId);
        require(getUnclaimedTokens() >= amount, "amount  is bigger then the liquidity left, try later");

        ERC20._mint(account, amount);
        _supplyLeft = _supplyLeft.sub(amount);
        emit  Mint(address(this), account, amount, appTransactionId);

    }

    function burn(uint256 amount) external onlyFeesAccount {
        _burn(_feesAccount, amount);
    }

    //********************Token methods end************************//

    //********************Game actions methods************************//


}
